import { Acceleration, Angle, AngularAcceleration, AngularSpeed, Current, DerivedUnit, Force, Length, Mass, MomentOfInertia, Momentum, Power, Speed, Temperature, Time, Torque, Unit, Voltage } from '.';
/**
 * Units
 *
 * Object describing a collection of relevant units
 */
export interface Units {
    LENGTH: Unit<Length>;
    SPEED: DerivedUnit<Speed>;
    ACCELERATION: DerivedUnit<Acceleration>;
    MASS: Unit<Mass>;
    PLANE_ANGLE: Unit<Angle>;
    ANGULAR_SPEED: DerivedUnit<AngularSpeed>;
    ANGULAR_ACCELERATION: DerivedUnit<AngularAcceleration>;
    TIME: Unit<Time>;
    FORCE: Unit<Force>;
    VOLTAGE: Unit<Voltage>;
    CURRENT: Unit<Current>;
    POWER: Unit<Power>;
    TORQUE: Unit<Torque>;
    MOMENTUM: DerivedUnit<Momentum>;
    MOMENT_INERTIA: Unit<MomentOfInertia>;
    TEMPERATURE: Unit<Temperature>;
}
